 geographic area. The Average Household Size is calculated by dividing the number of persons living in households by the total number of households in the current year. Households include all the people who occupy a housing unit (such as a house or apartment) as their usual residence.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"_5YEARINCREMENTSMEDAGE_CY":{"type":"number","alias":"2025 Median Age","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 estimate of the Median Age of the population in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"HEALTHMEDHINC_CY":{"type":"number","alias":"2025 Median Household Income","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 estimate of Median Household Income in the geographic area. Median Household Income is the amount that divides household income (annual income for all household earners age 15+) into two equal groups in a geographic area; half of the population will have income higher than the median and half will have lower income. If the median falls in the upper income interval of $500,000+, it is represented by the value of $500,001. Esri uses the U.S. Census definition of income; reference <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>Esri Essential Vocabulary</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSMEDVAL_CY":{"type":"number","alias":"2025 Median Home Value","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 estimate of the Median Home Value in the geographic area. Median Home Value divides home values into two equal groups; half of the homes will have a value higher than the median, and half lower. If the median is $2,000,000+, it is represented by a value of $2,000,001.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"HOUSINGHOUSEHOLDX3004_X_A":{"type":"number","alias":"2025 Mortgage/Oth Loan Pymts/Costs: Average","vintage":"2025","source":"Esri-U.S. BLS","units":null,"decimals":null,"definition":"Esri 2025 estimates of the total (aggregate) amount spent, average amount spent per household, and Spending Potential Index (SPI) on <em>Mortgage/Other Loan Payments & Costs</em> in the geographic area. Includes expected spending on the payment of mortgage principal and interest on primary loans, home equity lines of credit (HELOC), home equity loans, as well as special lump-sum mortgage payments, special assessments, closing costs, property taxes, homeowners insurance, and ground rent. Esris Consumer Spending data provides information about the estimated spending by households for goods and services in an area. The aggregate value represents the total amount spent by all households. The average value represents the typical amount spent per household. The SPI compares average local expenditures to U.S. levels. The SPI value for the U.S. is 100. If, for example, the SPI value for a geographic area is 120 this implies that average spending by consumers in the geographic area is likely to be 20 percent more than the U.S. average. Sources: Esri and Bureau of Labor Statistics. See <a target='_blank' href='https://links.esri.com/demographics/consumer-spending'>Consumer Spending data</a> for more information."},"HOUSEHOLDTOTALSINCMORT_CY":{"type":"number","alias":"2025 Pct of Income for Mortgage","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 estimate of the Percent of Income for Mortgage (POIFM) in the geog r","templateName":"dataCollectionsCalculator.HEALTHMEDHINC_CY","type":"esriFieldTypeDouble","vintage":"2025","source":"Esri","definition":"Esri 2025 estimate of Median Household Income in the geographic area. Median Household Income is the amount that divides household income (annual income for all household earners age 15+) into two equal groups in a geographic area; half of the population will have income higher than the median and half will have lower income. If the median falls in the upper income interval of $500,000+, it is represented by the value of $500,001. Esri uses the U.S. Census definition of income; reference <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>Esri Essential Vocabulary</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.KEYUSFACTSMEDVAL_CY":{"id":"MEDVAL_CY","fullName":"KeyUSFacts.MEDVAL_CY","alias":"2025 Median Home Value","fieldName":"KEYUSFACTSMEDVAL_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSMEDVAL_CY","type":"esriFieldTypeDouble","vintage":"2025","source":"Esri","definition":"Esri 2025 estimate of the Median Home Value in the geographic area. Median Home Value divides home values into two equal groups; half of the homes will have a value higher than the median, and half lower. If the median is $2,000,000+, it is represented by a value of $2,000,001.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.HOUSINGHOUSEHOLDX3004_X_A":{"id":"X3004_X_A","fullName":"HousingHousehold.X3004_X_A","alias":"2025 Mortgage/Oth Loan Pymts/Costs: Average","fieldName":"HOUSINGHOUSEHOLDX3004_X_A","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCo
